import './App.scss';
import {Routes, Route} from "react-router-dom";
import Layout from './components/Layout';
import Email from "./components/Email";


function App() {
  return (
    <Routes>
      <Route path="/" element={<Layout />} />
      <Route path="/Email" element={<Email />} />
    </Routes>
    );
}

export default App;
